script: |
  super -f text -I q3241.spq | sort > q3241.out

inputs:
  - name: q3241.spq
    data: |
      SELECT col0 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT ( ( NULL BETWEEN - col0 - - + col2 AND + col0 * + - 96 * + col2 + - - col1 ) );
  - name: tab1

outputs:
  - name: q3241.out
    data: |
